import React from "react";
import { Form } from 'react-bootstrap'

function AboutMe() {
  return (
    <Form>
      <Form.Label >About Me</Form.Label>
      <Form.Control as="textarea" rows="3" />
    </Form>
  );
}

export default AboutMe;
